    false,nt"url": null,nt"notes": "In 1962, Congress authorized the Continental
    Margin Program, a joint program between the U.S. Geological Survey (USGS) and the
    Woods Hole Oceanographic Institution (WHOI) to conduct a geological reconnaissance
    investigation of the continental shelf and slope off the Atlantic coast of the United
    States. As part of this program 464 photographs were collected at 378 stations from
    the Canadian border to the southern tip of Florida. Bottom photography was conducted
    at many of these stations in conjunction with sediment sampling for grain size,
    mineralogy, geochemistry, and biology. Those photographs have been scanned and are
    archived here to release a digital version of the historical dataset.",nt"license_title":
